window.bookSummaryJSON = "<p><b>In the modern world, qi is money.</b></p> <p>The days of traveling martial artists and mountaintop masters are over. Power is controlled by corporations, modernized martial arts sects, and governments. Those at the bottom of society struggle as second class citizens in a world in which power is a commodity.</p> <p>Rick is a young fighter in this world. He doesn't dream of immortality or becoming the strongest, just of building a better life for himself and his sister, who suffers from a spiritual illness. Unfortunately, life isn't that easy....</p>"; 
